@-moz-document url("http://www.google.com/") {
	page {
		color:#C1BEBA !important;
		background-color:#191919 !important;
    }

	body {
		color:#C1BEBA !important;
		background-color:#191919 !important;
		background-image: none !important;
    }

	td {
		color:#C1BEBA !important;
		background-color:#191919 !important;
    }

	div {
		color:#C1BEBA !important;
		background-color:#191919 !important;
    }

	a {
		color: #42749F !important;
	}

	a:visited {
		color: #882C55 !important;
	}

	a:active {
		color: #6799C4 !important;
	}

	#guser {
		color: #D1CECA !important;
	}

  img[src*="/logos/"],
  img[src*="/intl/"],
  img[src*="logo.gif"] {
    width: 0 !important;
    height: 110px !important;
    padding-left: 276px !important;
    background-image: url("data:image/gif;base64,%3D%3D");
    background-position: top left;
    background-repeat: no-repeat;
  }

}
